export default function Sponsors() {
  return (
    <div className="mt-20">
      <div className="flex justify-center items-center flex-col max-w-7xl bg-emerald-200 font-Inter pt-20 px-5">
        <h3 className="text-emerald-900 text-5xl font-extrabold text-center">
          Brought to you by
        </h3>
        <img class="mt-10 max-h-10" src={require("./Tutor.png")}></img>
        <img class="mt-10" src={require("./Baum.png")}></img>
      </div>
    </div>
  );
}
